import React from "react";
import axios from "axios";

const ViewPost = ({ post }) => {
  return <div>{post.title}</div>;
};

export default ViewPost;

ViewPost.getInitialProps = async ({ query: { postid } }) => {
  const post = await axios.get("/api/posts/" + postid);
  return { post };
};
